import React, {Component} from "react";

class SearchPage extends Component {
    constructor(props){
        super(props)
        this.state={
            balance:'$0'
        }
        this.handleInput= this.handleInput.bind(this)
    }


    render(){
        return (
            <form>
            <input type="text" placeholder="Search.." name="search" />
            <button type="submit"/>
            </form>
        )
    }
}

export default SearchPage;
